import React, { Component } from 'react';
import { inject, observer } from 'mobx-react';

@inject('postStore') @observer
class Post extends Component {


    render() {
        const { post } = this.props;
        return (
            <div>
                <h1>{post.title}</h1>
            </div>
        );
    }
}

export default Post;
